import React from 'react';
import Navbar from './components/Navbar/Index';
import {BrowserRouter as Router} from  'react-router-dom'
import Sidebar from './components/sidebar';
function App() {
  return (
    <Router>
      <Sidebar/>
      <Navbar/>
    </Router>
  );
}

export default App;
